window.bookSummaryJSON = "<p>King Maximilian Storm faces a new set of challenges as a Sovereign. Every action he takes, every decision he makes, impacts the lives of his people instead of just himself or his party.<br> <br> With the heart of his kingdom restored, Max hopes to focus on building up Stormhaven, feeding and protecting his people for a while. But escalating hostilities by Queen Anastasia, the red-eyed orcs from the north, as well as the orc War Chief An’zalor, force him to continue fighting.<br> <br> At the same time, he’s trying to recover the lost rune magic of the dwarves, while also learning about and activating his newly acquired dungeon core as the ruthless and relentless guild of dark elf assassins are trying to claim his head.</p>"; 
